import React, { useState } from "react";
import { Button } from "../components/common/button/btn";
import { LoginModal } from "../containers/modal";

const TalkPage = () => {
  const [open, setOpen] = useState(false);
  return (
    <div className='w-full'>
      <div className='w-full'>
        <Button onClick={() => setOpen(true)}>Create Talk</Button>
        <Button onClick={() => setOpen(true)}>Join Talk</Button>
      </div>
      <div
        className={`${
          open ? "flex" : "hidden"
        } fixed top-0 right-0 z-20 w-full bg-transparent h-screen grid
         grid-cols-1 items-center justify-items-center`}
      >
        <LoginModal setOpen={setOpen} />
      </div>
    </div>
  );
};

export default TalkPage;
